function click() {
    var DialogExport = this.require('DialogExport'),
    system = this.require('designer').system(),
    message = this.require('message');

    if (system && Object.keys(system).length) {
        DialogExport = new DialogExport({
            'title': 'Copy the link to the system'
        });
        DialogExport.show();
        DialogExport.on('ok', function () {
            this.hide();
        });
        message.success('the url has been generated.')
    }    
}
